        async Task SendRequest(string ip, int i)
        {
            var proxy = new WebProxy
            {
                Address = new Uri($"http://" + ip),
                BypassProxyOnLocal = false,
            };
            var httpClientHandler = new HttpClientHandler
            {
                Proxy = proxy,
            };
            using (var client = new HttpClient(handler: httpClientHandler, disposeHandler: true))
            {
                client.BaseAddress = new Uri("https://strawpoll.com/");
                try
                {
                    string content1 = "{" + '"' + "content_id" + '"' + ":" + '"' + c_id.Text + '"' + "," + '"' + "checked_answers" + '"' + ":" + '"' + answerid + '"' + "," + '"' + "name" + '"' + ":" + "null" + "}";
                    Console.Write(content1);
                    var content = new StringContent(content1, Encoding.UTF8, "application/json");
                    var result = await client.PostAsync("/api/poll/vote", content);
                    string resultContent = await result.Content.ReadAsStringAsync();
                    dynamic data = JObject.Parse(resultContent);

                    if (data.success == "1")
                    {
                        output.Text += "Vote " + i + ": ";
                        total++;
                    }
                    else
                    {
                        output.Text += "Retrying vote " + i + ": ";
                        SendRequest(proxies[ran.Next(0, proxies.Length)], i);
                    }
                    output.Text += data.message + "\n";
                    success.Text = "Votes sent: " + total;
                    fail.Text = "Votes failed: " + failed;



                }
                catch (Exception ex)
                {
                    output.Text += "Vote " + i + " failed (proxy timed out).\n";
                    failed++;
                }
                progress.Value = total + failed;
                if (progress.Value == progress.Maximum)
                {
                    output.Text += "Done: " + total + " votes sent, " + failed + " votes failed\n";
                }
            }
        }
        void Main()
        {
            output.Text = "";
            failed = 0;
            total = 0;
            WebClient client = new WebClient();
            string json = client.DownloadString("https://strawpoll.com/api/poll/" + c_id.Text);
            dynamic data = JObject.Parse(json);
            JArray items = (JArray)data.poll_answers;
            int length = items.Count;
            for (int i = 0; i < length; i++)
            {
                if (data.poll_answers[i].answer == c_ans.Text)
                {
                    answerid = data.poll_answers[i].id;
                    break;
                }
            }
        }
        bool inputvalid = true;
        private void GetProxy()
        {
            if (answerid.Length > 0)
            {
                if (Int32.TryParse(n_req.Text, out int n))
                {
                    if (proxy_arr.Text.Length > 0)
                    {
                        char[] delimiterChars = { ' ', ',', ';', '\t' };
                        try
                        {
                            inputproxies = proxy_arr.Text.Split(delimiterChars);
                        }
                        catch (Exception) { inputvalid = false; }
                    } else
                    {
                        inputvalid = false;
                    }
                    progress.Value = 0;
                    progress.Maximum = n;
                    if (inputvalid)
                    {
                        output.Text += "Submitting " + n + " votes to answerid: " + answerid + " using custom proxy list...\n";
                    }
                    
                    
                    for (int i = 1; i <= n; i++)
                    {
                        string ip = "";
                        if (inputvalid)
                        {
                            ip = inputproxies[ran.Next(0, inputproxies.Length)];
                        }
                        else
                        {
                            ip = proxies[ran.Next(0, proxies.Length)];
                        }
                        output.Text += "Sending vote " + i + " using " + ip + "\n";
                        SendRequest(ip, i);
                    }
                }
                else
                {
                    output.Text += "Failed to parse number of requests";
                }
            }
            
            
        }

        private void Output_TextChanged(object sender, TextChangedEventArgs e)
        {
            output.ScrollToEnd();
        }

        private void InputChanged(object sender, TextChangedEventArgs e)
        {
            TextBox t = (TextBox)sender;
            string placeholder = t.Name + "_p";
            switch (t.Name)
            {
                case "c_id":
                    if (t.Text.Length > 0)
                    {
                        c_id_p.Opacity = 0;
                    } else
                    {
                        c_id_p.Opacity = 0.5;
                    }
                    break;
                case "c_ans":
                    if (t.Text.Length > 0)
                    {
                        c_ans_p.Opacity = 0;
                    }
                    else
                    {
                        c_ans_p.Opacity = 0.5;
                    }
                    break;
                case "n_req":
                    if (t.Text.Length > 0)
                    {
                        n_req_p.Opacity = 0;
                    }
                    else
                    {
                        n_req_p.Opacity = 0.5;
                    }
                    break;
                case "proxy_arr":
                    if (t.Text.Length > 0)
                    {
                        proxy_p.Opacity = 0;
                    }
                    else
                    {
                        proxy_p.Opacity = 0.5;
                    }
                    break;
            }
        }
        

